import axios from "axios";
import { useState, useEffect } from "react";

const ListPage = () => {
    const [posts, setPosts] = useState([]);

    const getPosts = () => {
        axios.get('http://localhost:3009/posts').then((res => {
            setPosts(res.data);
        }))
    }

    useEffect(() => {
        getPosts();
    }, []);



    return <div>List PAGE</div>;
};

export default ListPage;
